<!doctype html>
<html lang="fr">

<head>
    <meta charset="utf-8">
    <title>Slider</title>

    <style type="text/css">

        body {
            font-family: "lato", sans-serif;
            text-align: center;
            width: 85vv;
            background-color: rgba(245, 239, 237, 1);
        }

        #slider {
            position: relative;
            margin: auto;
        }

        #slider > iframe {
            width: 100%;
            height: 65vh;
            border: 0;
        }

        #precedent, #suivant {
            cursor: pointer;
            transition: opacity 0.3s ease;
            opacity: 0.5;
            position: absolute;
            top: 45vh;
            font-size: 50px;
            color: rgba(220, 220, 220, 0.8);
            background-color: rgba(0, 0, 0, 0.8);
            padding: 10px;
        }

        #precedent {
            left: 0;
        }

        #suivant {
            right: 0;
        }

        #precedent:hover , #suivant:hover {
            opacity: 1;
        }


        ol {
	position: relative;
	display: block;
	margin: 50px;
	height: 4px;
	background: #31708F;
}
ol::before,
ol::after {
	content: "";
	position: absolute;
	top: -8px;
	display: block;
	width: 0;
	height: 0;
  border-radius: 10px;
	border: 10px solid #31708F;
}
ol::before {
	left: -5px;
}
ol::after {
	right: -10px;
	border: 10px solid transparent;
	border-right: 0;
	border-left: 20px solid #31708F;
  border-radius: 3px;
}

/* ---- Timeline elements ---- */
li {
	position: relative;
	display: inline-block;
	float: left;
	width: 150px;
	font: bold 14px lato;
  height: 50px;
}
li .parcelle {
  position: absolute;
  top: 8px;
  color: #000000;
}
li .point {
	content: "";
	top: -4px;
	left: 43%;
	display: block;
	width: 6px;
	height: 6px;
	border: 4px solid #31708F;
	border-radius: 10px;
	background: #fff;
  position: absolute;
}

li .pointactive {
	content: "";
	top: -8px;
	left: 43%;
	display: block;
	width: 12px;
	height: 12px;
	border: 4px solid #31708F;
	border-radius: 10px;
	background: #fff;
  position: absolute;
}

/* ---- Hover / Active effects ---- */

.point:hover {
    cursor: pointer;
    content: "";
	top: -8px;
	left: 43%;
	display: block;
	width: 12px;
	height: 12px;
	border: 4px solid #31708F;
	border-radius: 10px;
	background: #fff;
  position: absolute;
}

.pin:hover {
    cursor: pointer;
}

</style>


   
  
<script src="svg-pan-zoom.js"></script>
    <script type="text/javascript">
       
        var slide = new Array(
            ["http://pro.louislatour.com/zips/pano/Corton%20Perrieres/Vue01/vtourMobil/tour.html", "Corton Perrières"], 
            ["http://pro.louislatour.com/zips/pano/Corton%20Clos%20Du%20Roi/Vue01/vtourMobil/tour.html", "Corton Clos du Roi"],
            ["http://pro.louislatour.com/zips/pano/Beaune%20Perri%C3%A8res/Vue01/vtourMobil/tour.html", "Beaune Perrières"],
            ["http://pro.louislatour.com/zips/pano/Beaune%20Vignes%20Franches/Vue01/vtourMobil/tour.html", "Beaune Vignes Franches"],
            ["http://pro.louislatour.com/zips/pano/Chambertin%20Cuv%C3%A9e%20H%C3%A9ritier/Vue01/vtourMobil/tour.html", "Chambertin Hériter Latour"],
            ["http://pro.louislatour.com/zips/pano/Corton%20Bressandes/Vue01/vtourMobil/tour.html", "Corton Bressandes"],
            ["http://pro.louislatour.com/zips/pano/Corton%20Charlemagne/Vue01/vtourMobil/tour.html", "Corton Charlemagne"],
            ["http://pro.louislatour.com/zips/pano/Corton%20Greves/vtourMobil/tour.html", "Corton Grèves"],
            ["http://pro.louislatour.com/zips/pano/Pernand%20Vergelesses/Vue01/vtourMobil/tour.html", "Pernand-Vergelesses \"Ile des Vergelesses\""],
            ["http://pro.louislatour.com/zips/pano/Pommard%20Epenots/vtourMobil/tour.html", "Pommard-Epenots"],
            ["http://pro.louislatour.com/zips/pano/Roman%C3%A9e%20Saint%20Vivant/vtourMobil/tour.html", "Romanée-Saint-Vivant"],
            );
        var numero = 0;
        var label = '';
       
        
        function ChangeSlide(sens) {
            numero = numero + sens;
            if (numero < 0)
                numero = slide.length - 1;
            if (numero > slide.length - 1)
                numero = 0;
            document.getElementById("slide").src = slide[numero][0];
            document.getElementById("label").textContent = slide[numero][1];
        }


        function moveToSlide(n) {
            document.getElementById("slide").src = slide[n][0];
            document.getElementById("label").textContent = slide[n][1];
            hideMap();
        };

        function hideMap() {
          document.getElementById("Container").style.display = "none";
          document.getElementById("slider").style.display = "block";
          document.getElementById("mapexplorer").style.display = "block";
        };

        function showMap() {
          document.getElementById("Container").style.display = "block";
          document.getElementById("slider").style.display = "none";
          document.getElementById("mapexplorer").style.display = "none";
        };

        
        

</script>




    </script>
